import React from 'react';
import { Link } from 'react-router-dom';

export default function AdminHome() {
  return (
    <div style={{ textAlign: 'center' }}>
      <h1>Welcome Admin</h1>
      <div style={{ marginBottom: '20px' }}>
        <Link to="/expertRegistration" style={{ marginRight: '20px' }}>Expert Registration</Link>
        <Link to="/adminHome/manageAccount" style={{ marginRight: '20px' }}>Manage Account</Link>
        <Link to="/adminHome/createQuizCategories" style={{ marginRight: '20px' }}>Create Quiz Categories</Link>
        <Link to="/adminHome/addQuizzes">Add Quizzes</Link>
      </div>
    </div>
  );
}
